import React from "react";
import { Link } from "react-router-dom";
import DateCard from "../DateCard/DateCard";
import HexaOptions from "../HexaOptions/HexaOptions";
import './ScheduledWrkshp.scss'

export default function ScheduledWrkshp() {

    const options = [
        { title: 'Batch' },
        { title: 'Seats available' },
        { title: 'filled seats' },
        { title: 'Event day', link: '/manager/workshop/event_day' },
        { title: 'Change venue' },
        { title: 'Change schedule' },
        { title: 'Add new schedule' },
        { title: 'Cancel schedule' }, { gfd: 'fx' }
    ]

    const len = options.length
    const firstrow = options.splice(0, len / 2)
    const secondrow = options.splice(0, len / 2 + 1)


    return (
        <>
            <div className="ScheduledWrkshp">
                <h6>Scheduled</h6>
                <div>
                    <h3>Kochi</h3>
                </div>
                <div>
                    <h6>10 days to go</h6>
                </div>

                <div className='DateCards'>
                    <DateCard date={"01"} month={'October'} day={'Tuesday'} />
                    <DateCard date={"02"} month={'October'} day={'Wednesday'} />
                    <DateCard date={"03"} month={'October'} day={'Thursday'} />
                </div>
                <div className='options'>
                    <p>Change schedule</p>
                    <p>Change venue</p>
                    <p>Seats available</p>
                    <p>Add new schedule</p>
                    <p>Batch</p>
                    <p>filled seats</p>
                    <Link to={'/manager/workshop/event_day'}>
                        <p>Event day</p>
                    </Link>
                    <p>Cancel schedule</p>
                </div>
                <div className="firstRow">
                    {firstrow.map((obj, index) => {
                        return (
                            <HexaOptions>
                                <p key={index}>{obj.title}</p>
                            </HexaOptions>
                        )
                    })}
                </div>
                <div className="option">
                {secondrow.map((obj, index) => {
                        return (
                            <HexaOptions>
                                <p key={index}>{obj.title}</p>
                            </HexaOptions>
                        )
                    })}
                </div>

            </div>
        </>
    )
}
